import React from "react";
import Card from "../../common/card";
import { Row, Col } from "react-bootstrap";
import "./movie.css";

function Movies(props) {
  const movies = [
    { name: "mai", id: 1 },
    { name: "mm", id: 2 },
    // { name: "mm", id: 3 },
    // { name: "mm", id: 4 },
    // { name: "mm", id: 5 },
    // { name: "mm", id: 6 },
    // { name: "mm", id: 7 },
    // { name: "mm", id: 8 },
  ];

  return (
    <>
      <div className="all-movies">
        <Row>
          <Col
            style={{
              backgroundColor: "red",
            }}
          >
            <Card />
          </Col>

          <Col
            style={{
              backgroundColor: "blue",
            }}
          >
            <Card />
          </Col>
        </Row>
      </div>
    </>
  );
}

export default Movies;
